import React from "react";
import CustomNavbar from "./Header";
import "../Styles/home.css";
import{
  Card,
  CardBody,
  CardText,
} from 'reactstrap'

function Home() {
  return (
    <>
      <CustomNavbar />
      <div className="hcard">

        
         <p className="ctitle"> Table Question <br/> 
          Answering Model </p>


        <Card
          style={{
            width: "25 rem",
          }}  className="details"
        >
          <CardBody>
            <CardText className="CardText">
            Our Table Question Answering Model empowers users to get answers from tables using 
            natural language prompts. Users can upload CSV files, which are securely stored in a 
            structured database. After your data is uploaded, simply pose your questions, and the 
            system utilizes the "NumbersStation/nsql-350M" model to generate precise SQL queries 
            based on your input. These queries are executed in real-time against the database, 
            providing you with instant answers to your data inquiries.
            </CardText>
          </CardBody>
        </Card>
      </div>
    </>
  );
}

export default Home;
